B.KW=new A.ev("betpawa","betPawa | Online Sports Betting","Product design","As a Junior Product Designer at betPawa, I\u2019ve had the opportunity to work on a variety of impactful projects. I led the redesign and UX research for internal backend tools, improving their usability and efficiency for internal teams.\n\nOn the user-facing side, I\u2019ve contributed to key features on the homepage that improved user interaction and accessibility. I\u2019m also collaborating on several projects still in development, where I\u2019m involved in research, wireframing, prototyping, and delivering user-centered designs for both app and mobile.\n\nThis role allows me to work on diverse challenges, refine my skills, and make meaningful contributions to both internal and customer-facing experiences.\n          ","cover.webp",B.df,B.ch,B.ll,B.Gd,!0)
