B.KZ=new A.ev("imdb","IMDb mobile app","Redesign UX/UI","This project involved redesigning the IMDb mobile app, with the primary challenge being to understand the dynamic relationship between users and the database, and how they influence each other.\n\n\nOver time, the way users consume this type of data has evolved, from specialized magazines and newspapers to interactive experiences in virtual reality. The explosion of multimedia content, especially during the COVID-19 pandemic, coupled with the growing need for fast information consumption, sets the context for IMDb's role in this landscape.\n\n\nThe redesign process followed James Garrett's 5 Elements of UX: Strategy, Scope, Structure, Skeleton, and Surface.\n\n\nStrategy: I began by understanding both the users\u2019 needs and the business goals through comprehensive User Research. This involved surveys, interviews, benchmarking, persona creation, user journeys, and the DVF model.\n\nScope: I defined the project requirements, identified key focus areas, and outlined the tasks needed. Pain points were highlighted and possible solutions identified.\n\nStructure: A new Information Architecture was developed, incorporating tests like Card Sorting and Tree Testing. Wireflows and Taskflows were also designed at this stage.\n\nSkeleton & Surface: A prototype was created for remote testing, followed by the development of a Design System and style guide to ensure consistency across the app.","cover.webp",B.lx,B.ch,B.GZ,B.Gt,!1)
